def yo_noob(name: str, num: int) -> str:
    """
    Greeting to all noobs
    
    :param str name: user name
    :param int num: number
    :returns: hello noob with name
    :rtype: str
    """
    return f"yo noob: {name} {num}"

def f_noob(name: str, num: int) -> str:
    """
    Greeting to all noobs
    
    :param str name: user name
    :param int num: number
    :returns: hello noob with name
    :rtype: str
    """
    return f"f* noob: {name}{num}"

def who_noob(name:str) -> str:
    """
    Find out who's the noob

    :param str name: user name
    :returns: name of the noob
    :rtype: str
    """
    return f"Who's noob? {name}, you are a NOOB!!"

def no_noob() -> str:
    """
    No noob
    
    """
    return f"No Noob!!"